import Axios from "axios";
import React, { useState } from "react";

interface User {
  id: number;
  name: string;
  scheduled_to: string;
}

function AdminPage() {
  const [users, setUsers] = useState<User[]>();

  async function getUsers() {
    setUsers(await Axios.get("http://localhost:3003/culto"));
  }
  const signedUsers = users.map((user) => (
    <li key={user.data.id}>{user.data.name}</li>
  ));

  return (
    <div id="admin-page">
      <div className="content-wrapper">
        <ul>
          <li>Teste</li>
          <li>Teste</li>
          <li>Teste</li>
          <li>Teste</li>
          {users}
        </ul>
      </div>
    </div>
  );
}

export default AdminPage;
